		string ToHexUint16 (string ttt)
		{
			string sss = "";
			for (int n=0; n<ttt.Length; n=n+1)
			{
				string sdsd = ttt.Substring(n, 1).ToUpper();
				if (
					(sdsd == "0") |
					(sdsd == "1") |
					(sdsd == "2") |
					(sdsd == "3") |
					(sdsd == "4") |
					(sdsd == "5") |
					(sdsd == "6") |
					(sdsd == "7") |
					(sdsd == "8") |
					(sdsd == "9") |
					(sdsd == "A") |
					(sdsd == "B") |
					(sdsd == "C") |
					(sdsd == "D") |
					(sdsd == "E") |
					(sdsd == "F"))
				{
					sss = sss + sdsd;
				}
			}

			if (sss.Length>4)
			{
				sss = sss.Substring(sss.Length - 4);
			}

			return sss;
		}
		

